'use strict';
//@@DocInclude
//@@DocBrief("The class provides access to basic account information")
class AccountInfo {
    id;
    name;
    type;
    constructor() {
        this.id = null;
        this.name = null;
        this.type = null;
    }
    getId() {
        return this.id;
    }
    getName() {
        return this.name;
    }
    getType() {
        return this.type;
    }
}
module.exports = AccountInfo
